import React from 'react';
import './Product.css';

function Product({images}) {
  return (
    <div className="Product">
      <img src={images}></img>
      <h1>Товар</h1>
      <p>{ `${120} руб` }</p>
      <button>В корзину</button>
    </div>
  );
}

export default Product;
